import React from "react";

const Carrito = ({ carrito }) => {
  return (
    <div>
      <h2>Carrito de Compras</h2>
      <ul>
        {carrito.map((producto, index) => (
          <li key={index}>
            {producto.pr_descripcion} - ${producto.pr_precio}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Carrito;
